import { useState } from "react";
import "./App.css";
import watchCount from "./components/watchCount";
import HeaderTitle from "./components/HeaderTitle";
import Todos from "./components/Todos";

function App() {
  return (
    <div className="App">
      <watchCount />
      <HeaderTitle />
      <Todos />
    </div>
  );
}
export default App;
